export default class HumburgerIcon extends Component {
	render () { 
		return (<>
		<svg id="Layer_2" data-name="Layer 2" xmlns="http://www.w3.org/2000/svg" width={30} height={30} viewBox="0 0 20 20"><rect className="cls-1" x="0.25" y="2.79" width="19.51" height="2.48" rx="1.24" /><rect className="cls-1" x="0.25" y="8.76" width="19.51" height="2.48" rx="1.24" /><rect className="cls-1" x="0.25" y="14.73" width="19.51" height="2.48" rx="1.24" /></svg>
				</>);
	}
}
